import React, { useState } from 'react';
import 'bootstrap-icons/font/bootstrap-icons.css';

const Community = () => {
  const [lines, setLines] = useState([
    {
      id: 1,
      text: "Are you a camera? Because every time I look at you, I smile.",
      likes: 3,
      comments: ["So cute!", "Iâ€™d use this!"],
    },
    {
      id: 2,
      text: "You must be tired because youâ€™ve been running through my mind all day.",
      likes: 1,
      comments: [],
    },
  ]);

  const [newLine, setNewLine] = useState('');
  const [commentInputs, setCommentInputs] = useState({});

  const handleLike = (id) => {
    setLines(lines.map((line) =>
      line.id === id ? { ...line, likes: line.likes + 1 } : line
    ));
  };

  const handleCommentChange = (id, value) => {
    setCommentInputs({ ...commentInputs, [id]: value });
  };

  const handleCommentSubmit = (id) => {
    const comment = commentInputs[id]?.trim();
    if (!comment) return;

    setLines(lines.map((line) =>
      line.id === id
        ? { ...line, comments: [...line.comments, comment] }
        : line
    ));

    setCommentInputs({ ...commentInputs, [id]: '' });
  };

  const handleLineSubmit = (e) => {
    e.preventDefault();
    if (!newLine.trim()) return;

    const newEntry = {
      id: Date.now(),
      text: newLine.trim(),
      likes: 0,
      comments: [],
    };

    setLines([newEntry, ...lines]);
    setNewLine('');
  };

  return (
    <section className="container py-5">
      <div className="text-center mb-4">
        <h2 className="text-danger fw-bold">
          <i className="bi bi-people-fill me-2"></i>Community Pick-Up Lines
        </h2>
        <p className="text-muted">Share, like, and comment on user-generated pick-up lines ğŸ’¬</p>
      </div>

      {/* Form to submit new pick-up line */}
      <form onSubmit={handleLineSubmit} className="mb-4">
        <div className="input-group shadow-sm">
          <input
            type="text"
            className="form-control rounded-start"
            placeholder="âœ¨ Share your flirty genius..."
            value={newLine}
            onChange={(e) => setNewLine(e.target.value)}
          />
          <button className="btn btn-danger px-4" type="submit">Post</button>
        </div>
      </form>

      {/* Cards for each community line */}
      {lines.map((line) => (
        <div key={line.id} className="card mb-4 shadow-sm border-0 rounded-4">
          <div className="card-body">
            <p className="fs-5 mb-2">ğŸ’¬ {line.text}</p>

            <div className="d-flex justify-content-between align-items-center mb-3">
              <button className="btn btn-sm btn-outline-danger" onClick={() => handleLike(line.id)}>
                <i className="bi bi-heart-fill me-1"></i>{line.likes} Likes
              </button>
            </div>

            <div>
              <strong className="text-muted mb-1">ğŸ’­ Comments</strong>
              <ul className="list-group list-group-flush mb-2">
                {line.comments.map((comment, idx) => (
                  <li key={idx} className="list-group-item px-0 py-1 text-secondary">
                    <i className="bi bi-chat-left-text me-2"></i>{comment}
                  </li>
                ))}
              </ul>

              <div className="input-group">
                <input
                  type="text"
                  className="form-control"
                  placeholder="Write a comment..."
                  value={commentInputs[line.id] || ''}
                  onChange={(e) => handleCommentChange(line.id, e.target.value)}
                />
                <button
                  className="btn btn-outline-secondary"
                  onClick={() => handleCommentSubmit(line.id)}
                >
                  Reply
                </button>
              </div>
            </div>
          </div>
        </div>
      ))}
    </section>
  );
};

export default Community;
